import catan from "../images/Catan_Track.png"

function Projects() {

    return(
        <div id="projects" className="">
            <h2 className="">Projects Tiled</h2>
            <ul>
                <li>Catan Tracker</li>
                <li>Game</li>
                <li>Weather Forecast</li>
                <li>GitHub Link</li>
            </ul>
            {/* <ProjectTile title="Catan Tracker"/> */}
            <ProjectsGroup />
        </div>
    )
}//end method

function ProjectsGroup() {
    const data = [{imgSrc : catan, title : "Catan Tracker", body : "My Catan Tracking WPF app"}, {imgSrc : "https://placehold.co/300x200", title: "Game", body : "Simple Game"}, {imgSrc : "https://placehold.co/300x200", title : "Weather Forecast", body : "Api call to NWS and rendering response"}, {imgSrc : "https://placehold.co/300x200", title: "GitHub Link", body : "Check out my GitHub"}]

    const group = data.map(tile =>         
        <ProjectTile 
            title={tile.title} 
            body={tile.body}   
            imgSrc={tile.imgSrc}         
        />
    )

    return (
        <div className="row">
            {group}
        </div>
    )
}

function ProjectTile(props){
// Catan Tracker -- Game -- Weather Forecast -- Github Link    

    return (
        <div className="card m-1 p-1 col-md">
            <img className="card-img-top" src={props.imgSrc} alt="Card image cap"/>
            <div className="card-body">
                <h3>{props.title}</h3>
                <p className="card-text">{props.body}</p>
            </div>
        </div>    
    )
}

export default Projects;
